"announcement": "Welcome to Dazzling Expressions!  We are delighted to offer you a wide array of unique products for your special occasion!  Browse around and you will find a great collection of custom favors and decorations suitable for many tastes and styles!  If you can&#39;t find what you are looking for please let us know!  We will be happy to discuss a custom order with you!\r\n\r\n\r\n\r\n",
