"vacation_message": "I am currently on Jury Duty!  To avoid order delays and a backed up schedule I am not taking orders at the moment.  As soon as my civic duty is complete I will reopen and resume taking orders.  Outstanding orders should not be affected and should still ship as scheduled.  Thank you for your patience!",
"sale_message": "Thank you so much for your order!  Our current turnaround time is up to 7 to 10 business days from order date to ship date. There should be a scheduled ship date at the top of your order confirmation.  U.S. shipping is via USPS First Class and Parcel Post Mail which takes 2 to 8 days.  International orders can take anywhere from 1 to 8 weeks for shipping.   If you need your order sooner please contact us as soon as possible to make arrangements to upgrade your shipping to USPS Priority Mail or USPS Express Mail.  Also, please note that we ship to your ETSY address and NOT your paypal address so if your etsy address is not current please contact us right away with your correct shipping address.  We are pleased and grateful that you have chosen us to add our touch to your special occassion!\r\nA Million Thanks,\r\nIsabel\r\n**********ATTENTION INTERNATIONAL CUSTOMERS**********\r\nWe only collect the postage to SHIP your package to you.  We do not collect from you and therefore do not pay on your behalf any customs fees, duties, or taxes.  Any associated costs will be your responsibility.  We DO NOT have a way to calculate what those costs will be.  If this will create a problem for you please contact us immediately to cancel your order.  Thank you.",
