"accepts_custom_requests": false,
"policy_welcome": "WELCOME!\r\nHere at Dazzling Expressions each item is handled with love and care from the birth of the idea all the way to the packaging!  We love what we do and are honored to add our touch to your special day and it will certainly show when you receive your package!  We believe that customer service is the key and strive to provide the very best!  ",
"policy_payment": "PAYMENT\r\nWe currently accept payment via Paypal and etsy direct checkout..\r\n\r\nLEAD TIME\r\nOur products are custom made to order! Average lead time is 2 weeks from order date to ship date. This time may vary depending on the item, quantity and season. Allow time for shipping as well. If you need your order sooner please contact us before placing your order so we can insure that you will receive your order in time. We will do our best to accommodate you. A rush order fee may apply.\r\n\r\nPERSONALIZED ITEMS\r\nPlease indicate any information for personalization in the notes section at checkout. If you forget to include this information on your order please send us a convo or email with the information along with your order number. If you do not send this information it will delay your order.",
"policy_shipping": "DOMESTIC ORDERS\r\nWe ship via USPS.  We use First Class and Priority Mail.  Shipping time runs approximately 2 to 8 days. This does not include the time to process the order.  If you are in a time crunch and need your order quicker please contact me to make other shipping arrangements.\r\n\r\nINTERNATIONAL ORDERS\r\nWe have done our best to calculate accurate shipping rates for you.  If it seems excessive please contact us so that we can calculate and exact rate based on the items that you would like to order.  We us USPS for shipping and shipping time ranges from 6 days to 4 weeks.\r\n****PLEASE NOTE**** We collect ONLY the postage to SHIP your package to you. We do not collect from you and therefore do not pay on your behalf any customs fees, duties, or taxes. Any associated costs will be your responsibility when you receive your package. We are unable to calculate what these costs will be.",
"policy_refunds": "Due to the custom nature of our products ALL SALES ARE FINAL.\r\n\r\nBROKEN OR DAMAGED GOODS\r\nAll orders are very carefully and securely packaged however there is always a slight chance that an item may arrive damaged.  If you receive a damaged item please contact us within 3 business days of receiving your package so that we can issue a replacement immediately.\r\n\r\nMISTAKES\r\nWe carefully review all orders for correct spelling, color selections, etc.  However if you should receive your order and a mistake has been made on our part we will correct it immediately.  Please contact us within 3 days to make arrangements to rectify the situation.\r\n\r\nIf you have given us the wrong information for your order by mistake we will do our best to fix it for you.  If the order requires that it be shipped back to us to be fixed you will be responsible for the shipping cost to send it us and then back to you.  Please take your time and review the information that you submit to us to avoid any delays!\r\n\r\n\r\n\r\n",
"policy_additional": "FEEDBACK\r\nUpon receipt of your order we would love to have your feedback! If you are happy please let us know and leave positive feedback. If there is a problem with your order please contact us right away. We will do everything that we can to insure that you are 100% satisfied with your order. We are very reasonable and flexible so there should be no reason to leave negative feedback!\r\n\r\nPHOTOS\r\nPLEASE share your photos with us! We would love to add them to our listings and to our Facebook page to give others ideas and inspiration!\r\n\r\nPRODUCT VARIATION\r\nPlease note that our products are HANDMADE (never mass produced, always made to order)  therefore there may be slight variations and imperfections from item to item. This simply adds to the beauty of each unique piece!  Thank you for taking this into consideration.",
