"title": "Mid Century Style Furniture, Handcrafted For You",
"announcement": "The pieces in the Jeremiah Collection are crafted with over 21 years of furniture manufacturing experience.  Our pieces are hand made with timeless quality and design. In our shop we keep a fine balance of traditional and modern joinery that insures the best of both worlds.  We use only solid wood with a hand applied finish to let the natural beauty of the wood shine.  No stains or paint!!  We want the natural quality of the wood to speak for itself. Most of our designs have gone through many changes to ensure that all components used are the best of the best.  We are constantly striving to make our pieces reach the highest standard. \r\n\r\nWe would love it if you would come visit our creations in person! We&#39;re at 1608 Harrison st. San Francisco, CA 94103. Monday-Friday and most weekends. \r\n\r\n\r\nThanks!\r\nJeremiah \r\n\r\nFor custom inquiries please call: 415-866-9554 ",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Hey everyone! I’m not really on vacation:) We are taking the site down to do some listing adjustments and tweaking.  Be back Monday evening.",
"sale_message": "Thank you for shopping and supporting the Jeremiah Collection! We greatly appreciate you stopping by. \r\n\r\nWe will have your piece finished in a timely manner, as indicated in the description of the piece you purchased. All orders are currently on backorder and can take up to 3 months to receive. We are a small shop so keep that in mind. We work as fast as we can but will not risk quality.  If you have a party coming up and you need a beautiful piece of furniture to display, plan long lead times so that we can take the time to make it perfect for you! \r\n\r\nAll sales are final, payment in full is used for purchasing material and labor costs. \r\n\r\nThanks again for stopping by, we couldn&#39;t do it without you! ",
"digital_sale_message": null,
"last_updated_tsz": 1432213308,
"listing_active_count": 27,
"login_name": "jeremiahcollection",
"accepts_custom_requests": true,
"policy_welcome": null,
"policy_payment": "Since almost every piece of furniture is custom to order full payment is required before fabrication begins. There are no refunds.  I will work with you if thereis a manufacture defect. (failed joint, broken leg ect.) No refund also means that there is no cancellations on custom orders.  I am a small business and don&#39;t have the capitol to be giving refunds or returning money because you&#39;ve decided you don&#39;t want the table anymore.  That being said every one of my pieces is crafted to the highest quality. You will not be disappointed. \r\n\r\nHappy shopping!",
"policy_shipping": "For items under 5 feet we ship out in a custom made crate via FedEx, dismantling of the crate may require a drill or a strong hand and a screwdriver. (We recommend a drill). We try and give you the best customer service possible but we cannot be responsible for coordinating the delivery of the pieces after the first attempt. Please contact FedEx directly to schedule any second attempt at delivery. \r\n\r\nFor Items OVER 5 feet, we ship out using a white glove service. This is a meticulous   furniture moving service that blanket wraps the pieces and brings them right to your door. Pieces this large take MORE TIME to build and ship; approximately a month to deliver. Keep in mind that the Jeremiah Collection is NOT responsible for any damages made during shipping.  \r\n\r\nINFORMATION FOR SAN FRANCISCO BAY AREA ORDERS: \r\n-If you would like to PICK UP your piece use our coupon &quot;FREEPICKUP&quot; with purchase and contact us via Etsy to schedule the time. Items are available for pick up Monday - Friday 10am-5pm\r\n\r\n-If you would like to have your piece DELIVERED use our coupon code &quot;HOMEDELIVERY&quot; and purchase our Bay Area Delivery package via this link: https://www.etsy.com/listing/179621189/sf-and-bay-area-home-delivery\r\n\r\nAt this link you will be able to choose SF Delivery charge of $75 or Greater Bay Area Charge $150.00 (Both of these are hand delivered by us, the same folks that made your piece, without having to open a crate!)",
