"title": "Handmade Furniture and Decor from Reclaimed Materials",
"announcement": "We are a dad & daughter team using reclaimed materials to create handcrafted furniture & housewares filled with charm and character. \r\n\r\nAll of our items are handmade from reclaimed materials. Please keep in mind that our products may have knots, cracks, discolorations, etc. adding charm and character to these unique pieces.\r\n\r\nhttps://www.facebook.com/DesignsByADadAndADaughter",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for purchasing from Designs By A Dad and A Daughter! We are currently processing your order and it will be on it way to you soon!\r\n\r\nTo stay up to date with our newest products and to get sneak peaks at future products by following us on Facebook at: https://www.facebook.com/DesignsByADadAndADaughter",
"digital_sale_message": null,
"last_updated_tsz": 1431353431,
