"login_name": "brennabuscher1",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to Designs By A Dad and A Daughter! We are a Dad and Daughter team working hard to create furniture and housewares with excellent craftsmanship for you to enjoy and appreciate in your homes! All of our products are handmade from reclaimed materials. Thank you for visiting our shop!\r\n\r\nhttps://www.facebook.com/DesignsByADadAndADaughter",
"policy_payment": "Payments are accepted through Direct Checkout and Etsy Gift Cards",
"policy_shipping": "Please read our shop policies carefully before purchasing. Your purchase indicates your agreement with all of our policies.\r\n\r\nAll of our items ship via USPS or Fed Ex within 2-9 business days, if you need an item faster please message us for rush shipping prices. \r\n\r\nAt this time we only ship within the United States. Shipping prices posted are for the Continental US only. Please message us to inquire about shipping to Alaska and Hawaii.\r\n\r\nOur shipping costs are estimated, if the shipping cost is less than what is estimated we will happily refund you the remainder of the shipping cost. Please message us if you would like an exact shipping quote.\r\n\r\nAll of our packages are shipped with insurance. We are not responsible for lost or stolen packages.If you would like signature confirmation to your package please send us a message to add this cost to your order before checkout.\r\n\r\nWe are not responsible for items not received due to an incorrect address provided, etc. Please make sure to check that the address you enter upon checkout is correct. If the item is returned back to us due to an incorrect address provided, failure to deliver etc., the customer will be responsible for paying to ship the item a second time, or we will refund the order (minus original shipping). ",
"policy_refunds": "All of our items are handmade from reclaimed materials. Please keep in mind that our products may have knots, cracks, discolorations, etc. adding charm and character to these unique pieces.\r\n\r\nIf in the unlikely event you are not completely satisfied with the product you&#39;ve received we will try our best to make it right, please send us a message. If you would like to return/exchange the product, the buyer is responsible for shipping and ensuring the product is returned in the same condition it was received. Items must be returned within 10 days after it has been received, we cannot accept returns or exchanges on any product after 10 days.\r\n\r\nIf your item has arrived damaged, contact us immediately and send us pictures of the damaged goods and the original packaging within 5 days of receiving your package. If needed, we will supply you with a return label to send the damaged item back to our shop and we will send out a replacement for your item.\r\n\r\nRefunds, returns, or exchanges are not accepted for custom orders.",
"policy_additional": "As part of our effort to reduce waste and recycle, we try to re-use boxes for shipping our products whenever possible and do not include packing slips in the box. \r\n\r\nWe love to create custom pieces! If you&#39;re looking for something in particular or saw an item in our shop that sparked an idea send us a message, we would love to hear from you!\r\n\r\nOur pieces are made from reclaimed materials and although careful care is taken in sanding and designing all of our items, some pieces may have slight rough spots along wood edges etc. Please take care that any wall mounted products are hung safely and securely as specified in our instructions. Designs By A Dad and A Daughter are not responsible for any injuries that may occur from our products or installation.\r\n\r\nThanks for visiting our shop!",
