"title": "Square Bar Hairpin Legs - Raw Steel",
"description": "PRICE IS FOR EACH LEG! Update the quantity to suit your project&#39;s needs.\r\n\r\nView all sizes and shapes under &quot;Shop Sections&quot; at http://www.etsy.com/shop/ModernLegs\r\n\r\nHairpin table legs are the perfect way to turn a piece of reclaimed wood into a beautiful piece of furniture. These legs are made with 1/2&quot; square steel bar. Standard sizes are 4&quot; - 30&quot; tall, but I have made them as tall as 48&quot;. Great for anything from a coffee table to a kitchen table or even a modern looking office desk, these legs get their inspiration from Eames Era furniture design. \r\n\r\nThe L bracket is 5&quot; x 5&quot; and if it doesn&#39;t fit your project I can make any shape and design of bracket to accommodate. The mounting holes will accommodate up to 1/4&quot; hardware (not included).\r\n\r\nEvery piece is hand made to order by me. I am proud to say that my legs are 100% made in the USA from environmentally friendly, recyclable raw steel that is from a local steel mill, not China!  \r\n\r\nThe legs will ship with a slight amount of oily residue to keep them from rusting during transit. This is easily removed with a rag and a general household cleaner (NON ACIDIC / NON CITRUS). I recommend adding a clear coat or wax finish after cleaning to preserve their appearance.\r\n\r\nThere is a reason why my shop has more sales of hairpin legs than any other shop on Etsy, it is because I have over 17 years of welding experience and I provide a superior product! \r\n\r\nAsk about wholesale pricing for large orders.\r\n\r\nPRODUCTION TIME IS TWO WEEKS. \r\n\r\nPRICE IS FOR EACH LEG! Update the quantity to suit your project&#39;s needs.\r\n\r\nAll sales are final on custom orders. Standard sizes may be returned with buyer responsible for shipping. 10% restocking fee on all returned items.\r\n\r\nThanks for looking!",
