"description": "Degas, Dancers at the Bar on sheet music. \n\nBuy 2, get 1 Free\nBuy 3, get 2 Free\n\nView Degas&#39; Blue Dancers here: https://www.etsy.com/listing/230462512/degas-dancers-sheet-music-print-sheet\n\nView Degas&#39; The Dance Class (White) here: https://www.etsy.com/listing/232770548/degas-the-dance-class-1875-sheet-music\n\nSee the rest of my shop here: https://extraordinaryart.etsy.com\n-----------------------------------------------------------------------------------\n\nUnique works of art that will look great in any home, apartment or dorm room. Makes a great gift too. \n\nThese are printed using high end ink pigments which bring out an amazing range of colors and deep dark blacks. Printed in Santa Monica on fine art Swiss paper.\n\nPurchase 2 Sheet Music Prints, get a 3rd print free. Or buy 3 and get the 4th and 5th one free. Do not purchase your free print - leave the full name of the print(s) you would like for free in the box marked &quot;Message to ExtraordinaryArt&quot; when checking out.\n\nThis listing is for the print only. Frame is not included.\n\nSizes: \n4&quot; x 6&quot;\n5&quot; x 7&quot;\n8.5&quot; x 11&quot; (image formatted for 8x10)\n\nFeel free to ask me any questions.\n\n====================================================\nSee the rest of my shop here: https://extraordinaryart.etsy.com\n\n====================================================\nHilaire-Germain-Edgar Degas (1834–1917) was a passionate devotee of ballet—he knew the dancers, the music, the choreography. He also knew the work involved in the life of the dancer, the endless repetition of steps to achieve grace, agility, and expression. He pursued the subject for over 40 years through oils, pastels, drawings, prints, and sculpture, creating over 1,500 works devoted to the anatomy, posture, and movement of dancers. Degas’s Dancers at the Barre: Point and Counterpoint is the first exhibition of Degas’s dancers in Washington, D.C., in 25 years.\n\nThe impressionist master’s relentless experiments with movement and dance culminated in Dancers at the Barre (early 1880s–c. 1900).",
