"title": "Extraordinary Art. Antique artwork created for the modern home. ",
"announcement": "Buy 2 and get 1 free. Sheet music giclee artwork is available in the following sizes: 4x6, 5x7, and 8.5x11. Flat rate shipping ~ Pay shipping only on your 1st item; all other items ship free with your order (except for Mason Jars).\r\n\r\nWhen checking out just copy the title the free item(s) into the box marked &quot;Notes to ExtraordinaryArt.&quot;\r\n\r\nShipping charged for the first Sheet Music or Polaroid only, all other items ride along for free. Does not include Mason Jars.\r\n\r\nThanks so much for browsing my shop. Please let me know if you have any questions.\r\n\r\n*** Frames not included. ***\r\n\r\nAbout Polaroids:\r\nEach Polaroid Picture is a finely crafted work of art that you can hold in your hands. These Polaroid Pictures make great conversation pieces and enhance any room they are in. No two are the same, each one being unique creation. \r\n\r\nClassic works of art re-imagined on real Polaroid Photographs. From Alice in Wonderland to Degas, Picasso, Van Gogh, Cezanne, Klimt, Monet, and more. I can even turn your Instagram pictures into Polaroids. Perfect for your living room, library, or as wall art. Need a gift? Surprise a friend with this truly unique and original work of art. \r\n\r\nFollow me on Instagram:\r\n@polaroidartwork\r\nhttp://sheetmusicartprints.tumblr.com/\r\n\r\nPolaroid Format:\r\nFormat: 3.5 x 4.2 in (8.8 x 10.7 cm)\r\nImage area: 3.1 x 3.1 in (7.9 x 7.9 cm)\r\nFinish: Glossy\r\n\r\nSheet Music Format\r\nSizes:\r\n4x6\r\n5x7\r\n8.5x11 (formatted to fit an 8x10 frame)\r\n\r\nIf you are new to Etsy, this great tutorial makes purchasing easy: https://www.etsy.com/help/article/339\r\n\r\nAbout Analog Photography:\r\nUnlike with digital photography, analog instant photography is somewhat unpredictable, yet beautiful. Key to this is a chemical process that happens inside of the photo: after taking a picture, the film is pulled through camera rollers which break open a pod containing a reagent that is spread between the exposed negative and receiving positive sheet. Unlike roll film, integral film integrates all the layers to expose, develop, and fix the photo into a plastic envelope. There are no pixels, no digital data, but chemical components that react when exposed to light. This makes every picture literally unique. \r\n\r\nIf you have any questions please let me know. \r\n\r\nThanks,\r\n\r\nTom",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Hello, thanks for visiting. I am on out of the office this searching for new works of art to make into Polaroids. I will be available via email so if you have any questions please let me know.\r\n\r\nThanks,\r\n\r\nTom",
"sale_message": "You can follow me on:\r\nEtsy: https://www.etsy.com/shop/ExtraordinaryArt\r\nTumblr: https://SheetMusicArtPrints.tumblr.com",
"digital_sale_message": "Unless otherwise state on the photo you can:\r\n\r\nShare — copy and redistribute the material in any medium or format, just attribute it to Tom Hawkins.\r\nAdapt — remix, transform, and build upon the material, just attribute it to Tom Hawkins. This means you can put it on your blog, your website, etc.,. You just can&#39;t charge money for it.\r\nNonCommercial — Contact me if you want to sell any of this work. I&#39;ll be happy to discuss your use.",
