"policy_welcome": "Welcome to Extraordinary Art. I hope you enjoy the different works of art I have displayed here. I have tried my best to create unique pieces using traditional photographic techniques. \r\n",
"policy_payment": null,
"policy_shipping": "I use Flat Rate Shipping for the Sheet Music Prints and Polaroid Pictures. This means that no matter how many items are ordered, there is only one flat rate. For Example, whether you order 1 or 10 Sheet Music Prints or Polaroid Pictures, the shipping cost is the same. The cost of shipping includes the postal cost as well as the shipping material used.\r\n\r\nI automatically provide a shipping confirmation number for all US orders. I ship using high quality corrugated white cardboard boxes to protect the Polaroids during transit.  \r\n\r\nI ship internationally using Flat Rate shipping as well. Unfortunately shipping internationally costs more money so I have to charge a higher rate.",
