"description": "Hand painted mug with tie and &quot;awesome&quot; tie bar.\r\n\r\nFull disclosure- my dad pretty much only wears ties at weddings and funerals.  Okay, that&#39;s my stepdad.  But really, he&#39;s my dad.  My actual dad wore ties every day to work.  And he was a jerk. So does wearing a tie everyday make you a jerk?  I&#39;m not sure.  I&#39;d say there&#39;s no clear evidence (other than my father) and probably some university should study this.  \r\n\r\nHowever, if my stepdad were to wear ties all the time, he&#39;d definitely deserve an &quot;awesome&quot; tie bar.  I&#39;d get him one of those.  Cause duh, he&#39;s awesome.  If my actual dad were to wear a tie bar I&#39;d have to get a custom one to say &quot;douche&quot;. \r\n\r\nIf you would like this item customized in any way, I&#39;d be happy to do so. Want a special phrase? Please just send me a message so I can create your own unique design! If I don&#39;t get back to you right away, be patient.  I&#39;m probably shopping for ugly vintage ties.\r\n\r\nMug is microwave and dishwasher safe.  Ink is heat-set but please do not use abrasives on the drawn surface.\r\n\r\nNote, mug will be made to order so may vary slightly from photo.\r\n\r\n***Also, shipping cost is due to mug weight.  These are the old fashioned, heavy duty diner mugs.  They hold about 8 oz but weigh over a pound each!  If you get tired of drinking coffee you can use this as a light gym weight. :)***\r\n\r\nPlease visit the rest of my shop to see more freaking awesome stuff:\r\n✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪\r\nhttp://knotworkshop.etsy.com\r\n✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪",
