"vacation_message": "Hi, Debaucherous Bath will be putting the shop on vacation for the next few days to be able to get everything out the door and on its way to you faster! Debaucherous Bath will return refreshed and ready on Friday, January 30th at 9pm with our Valentine line up. All orders received up until January 27th will ship by Friday, January 30th. We will still be available to answer questions and concerns via convo and email. For more updates, please visit www.hausofhauntbath.blogspot.com. Thank you for your patronage and continued patience during this busy time. :-)",
"sale_message": "♦PLEASE READ♦: \r\n\r\n♥♥♥Thank you so much for your purchase!♥♥♥ \r\n\r\nPlease note, We will not be processing orders during this holiday weekend (Thursday May 21st to Monday May 25th) as we will be out of town for the holiday, but we will resume processing orders on Tuesday, May 26th. All orders will and have continued to ship as scheduled. Thank you and have a safe and fun holiday! \r\n\r\n\r\nTurn around time is 3-5 business days but typically 7-10 business days (unless otherwise noted), but *PLEASE* allow approx 21 full business days for your items to be shipped during sales/holiday season (usually ships much sooner, but this is worse case scenario, especially during the holiday season). Larger orders may take approx 30 business days to ship during busier times. Need it sooner? Contact me through my Etsy shop and let me know :)\r\n\r\nPLEASE READ (1) Free perfume petite sample with every order of $10 or more. You may choose a scent, but the free sample option does NOT APPLY to the scents listed below due to costs in formulating. Also, the free sample choice does not apply to past Halloween and Christmas scents as they are no longer available. \r\n\r\nTHESE SCENTS ARE NOT AVAILABLE:\r\n\r\nCoconut Blossom\r\nNightingale\r\nMarrakesh\r\nDebaucherous Amber\r\nHedonistic\r\nThe Queen Bee\r\nRumpelstiltskin\r\nBig Bad Wolf\r\nBeguiling Violette\r\nGolden Frankincense \r\nChocolade\r\nBella Miele\r\nChanteuse\r\nApothecary Rose\r\nArctic Wolf\r\n\r\nI try my best to accommodate all requests, but during busy times (especially from September through February) any requests made via convo may not always be fulfilled. Please make sure to include your request in the comments section at checkout. Thank you for your understanding!\r\n\r\nThank you!\r\n\r\n♦DEAR INTERNATIONAL BUYERS:\r\n\r\n♦INTERNATIONAL VAT TAXES & CUSTOMS FEES may be charged by your country&#39;s customs and/or postal system in order for you to receive your parcel. All items are shipped with exact purchase documented via custom&#39;s declarations. Payment of VAT taxes and customs fees are the legal responsibility of the buyer. \r\n\r\n♦Please do not ask to value your package at less than what you paid to avoid customs fees. This is considered illegal and we will not do it. Thank you for your understanding.\r\n\r\n♦INTERNATIONAL DUTY CALCULATOR can be very helpful to calculate your country&#39;s estimated VAT taxes and customs fees. Copy and paste the link below into your browser, select &quot;health and beauty&quot;, select sub-categories that describe the item you would like to purchase and then enter shipping weight (whipped soap averages around 7oz each, bubbling scrubs average around 10oz each and samples and lip balms usually average under 3oz (including the sets) http://www.dutycalculator.com/new-import-duty-and-tax-calculation\r\n\r\nThank you so much and have a fabulous day!",
