"description": "Our classic red lacquered rectangle wood serving tray is a wonderful decor accessory for the kitchen, party entertaining, a centerpiece, cocktails, office, coffee table or entry. The possibilities are limitless because everything looks better in a tray!\r\n\r\n• Available in two durable lacquered finishes - lustrous satin or sleek gloss. With each finish you can be confident in your trays&#39; wide range of uses; from storing books on the ottoman to carrying drinks.\r\n• Handcrafted with professional premium materials for quality craftsmanship.\r\n• You&#39;ll appreciate the details - the softened edges to the smooth brush-free finish, the felt pads on the bottom to the weight of quality. These details set our trays apart from any other.\r\n• 14&quot; w x 18&quot; l x 2.5” h (outside dimensions), 13&quot; w x 17&quot; l x 2&quot; h (interior dimensions)\r\n• Weighs approx. 6 lbs.\r\n• Please clean with a dry or damp soft cloth; not dishwasher safe.\r\n\r\nLooking for a 14 x 18  shallow tray or additional colors?\r\nwww.etsy.com/shop/GleamingRenditions?section_id=14270177\r\n\r\nWe offer a variety of trays in larger sizes for the ottoman or coffee table.\r\nwww.etsy.com/shop/GleamingRenditions?section_id=14574730\r\n_________________________\r\n\r\nPlease allow 1 - 2 weeks for production. Orders will ship the first Tuesday or Friday upon completion via FedEx Ground, which includes insurance and tracking. Delivery can be expected in 1 - 5 business days after shipment.\r\n_________________________\r\n\r\n*Please visit our Shop Policies for shipping and shop details.\r\nwww.etsy.com/shop/gleamingrenditions/policy\r\n\r\nVisit our shop for a variety of tray sizes and colors for your home and gift giving.\r\nwww.etsy.com/shop/gleamingrenditions",
