"title": "Custom Wedding & Party Favors and Bags",
"announcement": " Favor Bags & Decor for Wedding, Event or Business Celebrations. Bags, Tags, Boxes & Coffee Sleeves. From bridal showers to celebrity requests, I&#39;ll be happy to help you create something beautiful!\r\n\r\nCustom Favors featured at the birthday party of none other than &quot;Castle&#39;s&quot; Nathan Fillion, on MerryBrides, Julie Hanan Design & numerous other wedding & lifestyle blogs!   Let me help you create something beautiful for your wedding or help make your event a night to remember!\r\n\r\n+ I offer 5 star customer service & that personal touch you&#39;ve come to Etsy for\r\n\r\n+ 100% satisfaction is guaranteed or a no questions asked refund\r\n\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "I so appreciate you supporting my shop with me today.  Rest assured that your special delivery is on the fast track from Iowa!  If there is more I can help you with in the mean time, feel free to shoot me a convo.\r\n\r\n",
"digital_sale_message": null,
"last_updated_tsz": 1432212359,
"listing_active_count": 152,
"login_name": "LuxPaperRain",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to my little corner of Etsy.  I hope you enjoy browsing my work & find something that would make you smile .  I fell in love with creation in my childhood, sewing aprons for my Barbies & little stuffed bunnies alongside my mother & grandmothers as they quilted.  Now as a mother of four raising my family in the middle of the Midwest I make my creativity a part time career. \n       While my items are smoke & pet free, & I absolutely promise professionalism; I make no guarantees that the little hands of my 5 year old twins have not helped paint a few strokes on your sign or helped sew a bib button.  I sell in several venues, etsy being my newest, so I do spend a fair amount of time in my workshop.  I try to let my children be involved when appropriate, hopefully inspiring the next generation of craftswomen. \n        My shop motto reflects my belief that our creator is present in all the beautiful things surrounding us each day.  It thrills me to create works of scripture, hope, love & encouragement which will fill the homes of shoppers around the world, and gifts to be given in love.\n     I look forward to creating something wonderful for you!\n",
