"title": "Art Deco Drinks Glasses Turkish Coffee Pot Tumblers Black Gold Glass",
"description": "Vintage Art Deco drinks glasses, a set of 4 Turkish coffee pot glass tumblers made by the Federal Glass Company.  Circa 1930s\n\nCool graphic designs in black and gold with zigzags, dots and Turkish coffee pots. This is the glass for an exotic drink in a foreign port.\n\nFederal Glass Company started out making tumblers and by 1906 were also making bottles and jars.  By 1914 they were in full production of a wide variety of pressed glass and imitation cut glass patterns.  The company closed in 1980. \n\nAll four glasses are in excellent condition.  On two of them them the black pattern is slightly lighter.  Hand washing is recommended, the lighter pattern on those two may be the result of a trip through a dishwasher.\n\nMakers Mark:\nEach base has the imprint of an &quot;F within a shield&quot;, the mark for Federal Glass Company\n\nDimensions:\n4 7/8&quot; high\n\nDomestic Shipping includes delivery confirmation & insurance.\nInternational Shipping is available, please convo for cost.\n\n~••~•~•~••~•~•~••~•~•~••~•~•~••~•~•~••~•~•~••~•~•~••~•~•~••~\nback to shop, to see more vintage!\nTheVintaquarian.etsy.com\n~••~•~•~••~•~•~••~•~•~••~•~•~••~•~•~••~•~•~••~•~•~••~•~•~••~",
